import React, {useEffect, useState} from "react";
import "../../../css/header.css"

export default function Cost_calculation() {
    const [order, setOrders] = useState([]);

    const orders = () => {
        fetch("/order/get")
            .then(orders => orders.json())
            .then(orders => setOrders(orders))
    }

    const deleteById = (idElement) => {
        fetch("/order/deleteBy/id", {
            method: "DELETE",
            body: JSON.stringify({
                orderId: idElement
            }),
            headers: {
                "Content-Type": "application/json", charset: "UTF-8"
            }
        })
            .then(orders => orders.json())
            .then(orders => console.log(orders))
    }

    useEffect(() => {
        orders()
    })

    return (
        <>
            <div className="order">
                <table>
                    <tr>
                        <th>NAME</th>
                        <th>PHONE</th>
                        <th>DELETED</th>
                    </tr>
                    {
                        order.map((o) => (
                            <tr>
                                <td key={o.name}>{o.name}</td>
                                <td key={o.numberPhone}>{o.numberPhone}</td>
                                <td>
                                    <button onClick={() => {
                                        deleteById(o.id)
                                    }}>Delete</button>
                                </td>
                            </tr>
                        ))
                    }
                </table>
            </div>
        </>
    )
}
